import React from "react";
import Ranked from "./components/Ranked.js"
import { Route } from "react-router-dom";
import SearchBar from "./components/SearchBar";



class App extends React.Component{
    constructor(){
        super();
        this.state={
            body:[]
        }
    }

    componentDidMount(){
        fetch("/search")
        .then(res=> res.json())
        .then(body=>{
            this.setState(body);
        }).then(console.log(this.state.body));

    }

    render(){
        return(
            <div>
            <SearchBar searchBody={this.state.body}/>
            <Route path = "/ranked" component ={Ranked}></Route>
            </div>
        );
    }
}

export default App;
